  return (
    <div className="header">
      <img className="header__logo" src="http://pngimg.com/uploads/amazon/amazon_PNG11.png" alt="amazon" />
      <div className="header__search" type="text">
        <input className="header_searchInput" />
        <SearchIcon className="header__searchIcon/" type="text" />
      </div>
      <div className="header__nav">
        <div className="header__option">
          <span className="header__optionLineOne">Hello Guest</span>
          <span className="header__optioinLineTwo">Sign In</span>
        </div>
        <div className="header_option">
          <span className="header__optionLineOne">Returns</span>
          <span className="header_optionLineTwo">& Orders</span>
        </div>
      </div>
    </div>

  );
}

export default Header;
